import React from "react";
import styled from "styled-components";

const MainProjectConatiner = styled.div`
  max-width: 1280px;
  box-sizing: border-box;
  padding: 0 40px;
  margin: 0 auto;
  height: 752px;
  display: grid;
  grid-template-columns: 121fr 146fr 349fr 498fr 86fr;
  grid-template-rows: 254fr 378fr 120fr;
  .MainProjectLeft {
    width: 121px;
    position: sticky;
    top: 120px;
    height: 48px;
    grid-column: 1 / span 1;
    grid-row: 1 / span 1;
    font-size: 32px;
    font-family: Kanit;
    font-weight: bold;
    line-height: 48px;
    margin-top: 100px;
  }
  .MainToProject {
    display: block;
    text-decoration: none;
    font-size: 16px;
    font-family: NanumSquareR;
    line-height: 18px;
    color: #afafaf;
    margin-top: 13px;
  }
  .MainProjectTop {
    grid-column: 3 / span 2;
    grid-row: 1 / span 1;
    font-family: NanumSquareR;
    font-size: 18px;
    line-height: 34px;
    color: #101010;
    margin-top: 113px;
  }
  .MainSliderRange {
    grid-column: 3 / span 2;
    grid-row: 2 / span 1;
    background-color: #f2f2f2;
  }
  .Slides ul {
    display: flex;
    list-style: none;
  }
  .Slides ul li {
    width: 408px;
    height: 306px;
    margin-left: 32px;
    background-color: #fff;
  }
`;

function MainProject() {
  return (
    <MainProjectConatiner>
      <div className="MainProjectLeft">
        Project
        <a href="#" className="MainToProject">
          View Detail -
        </a>
      </div>
      <div className="MainProjectTop">
        31기수에 이르기까지 그동안 EC 선배들이 했던 프로젝트들이에요!
        <br /> 너무 많아서 몇 가지만 골라봤어요
      </div>
      <div className="MainSliderRange">
        <div className="Slides">
          <ul>
            <li>영역1</li>
            <li>영역2</li>
          </ul>
          <ul>
            <li>영역3</li>
            <li>영역4</li>
          </ul>
        </div>
        <div className="Navigation">
          <label class="Bar"></label>
          <label class="Bar"></label>
          <label class="Bar"></label>
        </div>
      </div>
    </MainProjectConatiner>
  );
}

export default MainProject;
